import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="center-column">
        <div className="item-row">
          <span>One</span>
        </div>
        <div className="item-row">
          <span>Two</span>
        </div>
        <div className="item-row">
          <span>Three</span>
        </div>
        <div className="item-row">
          <span>four</span>
        </div>
        <div className="item-row">
          <span>five</span>
        </div>
      </div>
    </div>
  );
}

export default App;
